import React, { useEffect, useState } from 'react';
import axiosInstance from '../axiosConfig';
import { useNavigate } from 'react-router-dom';

const UpdateProfile = () => {
    const [userData, setUserData] = useState({
        username: '',
        email: '',
        firstname: '',
        lastname: '',
        phoneNumber: '',
        birthdate: '',  // Add birthdate field
    });
    const navigate = useNavigate();

    useEffect(() => {
        const fetchUserData = async () => {
            const token = localStorage.getItem('token');
            const userId = JSON.parse(localStorage.getItem('user'))?.id;

            if (token && userId) {
                try {
                    const response = await axiosInstance.get(`/user/id/${userId}`, {
                        headers: {
                            Authorization: `Bearer ${token}`,
                        },
                    });
                    const fetchedUserData = response.data;

                    // Convert birthdate to YYYY-MM-DD format for the input field
                    const formattedBirthdate = fetchedUserData.birthdate 
                        ? fetchedUserData.birthdate.split('/').reverse().join('-') // Convert from dd/MM/yyyy to yyyy-MM-dd
                        : '';

                    setUserData({
                        ...fetchedUserData,
                        birthdate: formattedBirthdate,
                    }); // Populate the form with user data

                    // Update localStorage with the new user data
                    localStorage.setItem('user', JSON.stringify(fetchedUserData));
                } catch (error) {
                    console.error('Failed to fetch user data:', error.response ? error.response.data : error.message);
                    navigate('/login'); // Redirect to login if not authenticated or error
                }
            } else {
                console.error('No user data found, redirecting to login.');
                navigate('/login');
            }
        };

        fetchUserData();
    }, [navigate]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setUserData({
            ...userData,
            [name]: value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const token = localStorage.getItem('token'); // Fetch the token

        // Log user data and token for debugging
        console.log('User Data being sent:', userData);
        console.log('Token being sent:', token);

        if (token) {
            try {
                const response = await axiosInstance.get(`/user/update`, {
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });;
                console.log('Profile updated:', response.data);
                alert('Profile updated successfully!');

                localStorage.setItem('user', JSON.stringify(response.data));
                navigate('/dashboard');
            } catch (error) {
                console.error('Error updating profile:', error.response ? error.response.data : error.message);
                alert('Error updating profile. Please try again.'); // Inform the user of the error
            }
        } else {
            console.error('No token found, user not authenticated.');
            alert('You need to be logged in to update your profile.');
        }
    };



    return (
        <div>
            <h2>Update Profile</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Username:</label>
                    <input type="text" name="username" value={userData.username} onChange={handleChange} required />
                </div>
                <div>
                    <label>Email:</label>
                    <input type="email" name="email" value={userData.email} onChange={handleChange} required />
                </div>
                <div>
                    <label>First Name:</label>
                    <input type="text" name="firstname" value={userData.firstname} onChange={handleChange} required />
                </div>
                <div>
                    <label>Last Name:</label>
                    <input type="text" name="lastname" value={userData.lastname} onChange={handleChange} required />
                </div>
                <div>
                    <label>Phone Number:</label>
                    <input type="text" name="phoneNumber" value={userData.phoneNumber} onChange={handleChange} />
                </div>
                <div>
                    <label>Date of Birth:</label>
                    <input type="date" name="birthdate" value={userData.birthdate} onChange={handleChange} />
                </div>
                <button type="submit">Update Profile</button>
            </form>
        </div>
    );
};

export default UpdateProfile;
